var help366="ワイヤレス通信のデータを暗号化する方法は有線ネットワークと同じプライバシーレベルを提供することを意味します。WEPはWPA暗号化ほど、安全ではありません。WEPネットワークへのアクセスを行うには、キーを知っている必要があります。キーは、あなたが作成する文字列です。WEPを使う場合には、暗号化レベルを決定する必要があります。暗号化タイプはキー長を決定します。128ビット暗号化は64ビット暗号化よりも長いキーを必要とします。キーは16進数（0-9、A-Fの文字を使う）もしくはASCII（American Standard Code for Information Interchange-英数字）フォーマットの文字列で入力されます。ASCIIフォーマットは入力する文字列を覚えるのがより簡単です。ASCII文字はネットワークを介して使うために16進数に変換されます。簡単にキーを変更することができる4つのキーを定義することができます。デフォルトキーはネットワーク上で利用するために選択されます。";
var help368="64 ビットの 16 進数キーは 10 文字の英数字で表します。（64 ビットの暗号化方式の場合 12345678FA は有効な 10 桁の文字列です。）";
var help369="128 ビットの 16 進数のキーの長さは 26 文字となります。（456FBCDF123400122225271730　は  128 ビットの暗号化に有効な 26 文字の値です。）";
