var IPV6_TEXT9="ワイヤレスネットワークの安全性は転送される情報を保護するのと同様に重要です。ルータではWEP、WPA only、WPA2 only、及びWPA/WPA2 (auto-detect)の4タイプからワイヤレスセキュリティが使用可能です。";
var IPV6_TEXT10="Wired Equivalent Protocol (WEP)はWireless Local Area Networks (WLAN)のワイヤレスセキュリティプロトコルです。WEPではWLANを経由するデータを暗号化し、安全性を提供します。WEPでは64ビット及び128ビットの2段階の暗号化方式があります。WEP設定は既存のワイヤレスネットワークやワイヤレスネットワークをカスタマイズするとき等、必要に応じて変更することが可能です。";
var IPV6_TEXT11="認証とはワイヤレスネットワークに接続を試みるネットワークデバイスをルータが確認する過程をいいます。WEPを使用するデバイスの認証方法には２つのタイプがあります。";
var IPV6_TEXT12="ネットワーク接続を行うために提供される暗号化キーを必要とはせず、全てのワイヤレスデバイスがルータと通信を行うことを許可するこのオプションを選択してください。";
var IPV6_TEXT13="DIR-827との通信が許可される前に、ネットワークへの接続に必要とされる暗号化キーを提供するルータと全てのワイヤレスデバイスが通信を行うことを許可するオプションを選択してください。";
var IPV6_TEXT14="ネットワークで使用したいWEP暗号化レベルを選択してください。64ビット及び128ビットの２つのレベルから選択できます。";
var IPV6_TEXT15="DIR-827によりサポートされているキータイプは、HEX（Hexadecimal）およびASCII（American Standard Code for Information Interchange）です。キータイプは既存のワイヤレスネットワークに合わせて変更したり、カスタマイズしたりすることができます。";
var IPV6_TEXT16="キー";
var IPV6_TEXT17="キー1～4は安全なネットワークを維持するためのワイヤレス暗号化設定を簡単に変更することができます。ネットワークワイヤレスデータの暗号化を行うために特定のキーを選択してください。";
var IPV6_TEXT18="キータイプ";
var IPV6_TEXT19="WEP暗号化";
var IPV6_TEXT20="Wi-Fi Protected Access（WPA）はワイヤレスネットワークに接続を試みるユーザに権限を与え、承認します。WPAはWEPより強力なセキュリティとなり、通常のインターバル間隔でキーを変更します。";
var IPV6_TEXT21="WPAをセキュリティで使用している場合、DIR-827 は2つの暗号化モードがあります。TKIP (Temporal Key Integrity Protocol)及び、AES (Advanced Encryption Standard)の2つがあります。";
var IPV6_TEXT22="PSK/EAP";
var IPV6_TEXT23="PSKが選択されている場合、ワイヤレスクライアントは認証を行うためにパスフレーズを提供する必要があります。EAPが選択されている場合、ネットワークにワイヤレスクライアントの認証を制御するRADIUSサーバを設定する必要があります。";
var IPV6_TEXT24="パスフレーズ";
var IPV6_TEXT25="PSKが選択されている場合、DIR-827 と通信を行うためにワイヤレスクライアントには必要です。8～63文字の英数字で入力してください。ネットワークに新たにワイヤレスデバイスを追加する際にパスフレーズが必要となるため、設定したパスフレーズはメモとして残しておいてください。";
var IPV6_TEXT26="WPA認証では、ネットワーク上に存在するRADIUSサーバとの接続に使用します。RADIUSサーバへ設定するIPアドレス、ポート、及び共有キーを入力してください。ワイヤレスクライアントを認証するのに使用するネットワークに２つのRADIUSサーバがある場合には、セカンドRADIUSサーバへの情報を入力するオプションもあります。";
var IPV6_TEXT27="Wi-Fi Protected Access 2 (WPA2)はワイヤレスネットワークに接続を試みるユーザに権限を与え、承認します。WPA2はWEPよりも協力なセキュリティとなり、通常のインターバル間隔でキーを変更します。";
