var IPV6_TEXT95="ルータのLAN (Local Area Network) IPv6 インターフェイスの設定項目です。ルータのLAN IPv6アドレス設定はインターネットサービスプロバイダーによって割当てられたIPv6アドレス及びサブネットの情報を元に設定を行います。（prefix /64はLANで対応しています。）";
