var IPV6_TEXT97="ローカルエリアネットワーク上のコンピュータやデバイスへアドレスを割当てる時に使用するDHCPv6サーバの開始アドレス(from)から終了アドレス(to)までを定義します。定義されている範囲外のアドレスはDHCPv6サーバで管理を行いません。　ネットワークアドレス詳細を自動的に取得をDHCPv6からできないデバイスや手動で設定するデバイスには使用することができます。";
