var ADNS_HELP1="DNSはDomain Name Systemの略です。DNSサーバは電話帳のような働きをし、私達人間にとって理解しやすいようにIPアドレスに対応するドメイン名に変換します。Advanced DNSサービスはフィッシング対策及びDNSサービスを行っているOpenDNSの子会社であるBest Path Networksから提供されているサービスです。OpenDNSはフリーのセキュリティ及びDNSインフラサービスを提供する世界最大で急成長しているプロバイダです。Advanced DSNサービスを使用することにより、オンラインをより安全に、より早く、そして高い信頼性を提供いたします。";
var ADNS_HELP2="DNSプラットフォームはどんな特定のプロトコルにも干渉しないよう設計されています。存在していないドメインのサーチレスポンスを受信することにより、スパムフィルタリングソリューションの小さいなサブネット単位では混乱する場合があります。 オンサイトメールサーバの操作を行うクライアントのために、enhanced search experienceを無効にすることをおすすめしています。 DNSはアップロード及びダウンロードのスピードには影響しません。これらはインターネットサービスプロバイダによって制御されます。D-Link及びBest Path NetworksではAdvanced DNSサービスのユーザの個人と認識できる情報の収集および保存は行っていません。";
var ADNS_HELP3="Yahooによって、検索結果が表示されます。この機能により、使用しているブラウザを使用して、効率的に検索を行い目的に到達することが可能です。サイトが見つからない、もしくは存在しなかった場合、ブラウザにエラーメッセージを表示する代わりに、それに関連する検索結果を表示し、提案をおこないます。また、アドレスバーでユーザが起こすタイプミスを自動で修正します。.comや.org等のトップレベルドメインに対して入力したミススペルのみに、この機能は対応しています。まれに検索結果のページが間違った移動する場合があります。また、スパムメールの中に表示されているリンクをクリックしサイトに移動するとき、そのサイトが表示されない場合やアクセスを拒否されることがあります。これらの理由は検索結果に表示さらた";
